function TicketItem() {
    return ( 
        <div className="ticket-item"> 
            <div class>Date</div>
            <div className="ticket-item__employee">
                <h2>Employee Name</h2>
                <div className="ticket-item__info">
                    <div>Ticket #</div>
                    <div>Ticket Tier</div>
                </div>
            </div>
        </div>
    )
}

export default TicketItem;
